import './App.css';
import {BrowserRouter as Router,
Routes,
Route} from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <Router>
      <Navbar />
        <Routes>
          <Route exact path='/' element={<h1>Home</h1>}/>
          <Route path='movie/:id' element={<h1>Popular</h1>}/>
          <Route path='movies/:type' element={<h1>Type</h1>}/>
          <Route path='/*' element={<h1>ERRORRRRRRR</h1>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
